    void Write16Bit(INT8U dataH, INT8U dataL)
    {
        while (I8080_CONFIG_CMD & 1);   // wait till the busy bit became 0
        
        I8080_CYCLE = 20;
        I8080_START_1 = 2;
        I8080_END_1 = 18;
        I8080_START_2 = 4;
        I8080_END_2 = 16;
        I8080_DATA_RW = 0;
        I8080_CONFIG_CMD     = 	(0 << 14) |	// output_config_dc --- not change
        				(3 << 12) |	// output_config_cs --- toggle_2
        				(2 << 10) |	// output_config_wr --- toggle_1
        				(0 <<  8 ) |	// output_config_rd --- not change
        				(1 <<  7 ) |	// dc set to 1 (data)
        				(1 <<  6 ) |	// cs set to 1
        				(1 <<  5 ) |	// wr set to 1
        				(1 <<  4 ) |	 // rd set to 1 
        				(0 <<  0 );	// this is not a command, its just setting
        
        I8080_DATA_W = dataH;
        while (I8080_CONFIG_CMD & 1);   // wait till the busy bit became 0
        
        I8080_DATA_W = dataL;
        while (I8080_CONFIG_CMD & 1);   // wait till the busy bit became 0
    }
    
