    void WriteData(INT8U m_data, INT8U m_type)
    {
        if(m_type)
            OUTLV |= RSB;       //RS=1
        else
            OUTLV &= ~(RSB);       //RS=0
            
        OUTLV &= ~(CSB);       //CS=0
        OUTLV |= WRB;       //WR=1
        OUTLV &= ~(0xFF<<8);    //Clear Data
        OUTLV |= m_data<<8;  //Set Data
        
        OUTLV &= ~(WRB);       //WR=0
        delay_10us(1);
        OUTLV |= WRB;       //WR=1
        
        if(m_type)
            OUTLV &= ~(RSB);       //RS=0
        else
            OUTLV |= RSB;       //RS=1
            
        OUTLV |= CSB;       //CS=1
        delay_10us(1);
    }
    
